-- ----------------------------
-- Procedure structure for `sp_random`
-- ----------------------------
DROP PROCEDURE IF EXISTS `sp_random`;
DELIMITER ;;
CREATE DEFINER=`cbtsmbjm`@`%` PROCEDURE `sp_random`()
BEGIN
  
  DECLARE _nop VARCHAR (20) ;
  DECLARE _jns_peserta_id SMALLINT(6);
  DECLARE done INT DEFAULT FALSE ;
  DECLARE curs CURSOR FOR SELECT nop, jns_peserta_id FROM tb_peserta;
  DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE ;
  
  START	TRANSACTION;
  DELETE FROM tb_random;
  ALTER TABLE tb_random AUTO_INCREMENT = 1;
  SET @jml_m1 = (SELECT jml_soal FROM tb_materi WHERE materi_id=1);
  SET @jml_m2 = (SELECT jml_soal FROM tb_materi WHERE materi_id=2);
  SET @jml_m3 = (SELECT jml_soal FROM tb_materi WHERE materi_id=3);
  OPEN curs ;
  read_loop : LOOP
    FETCH curs INTO _nop, _jns_peserta_id ;
    IF done THEN 
	LEAVE read_loop ;
    END IF ;
	SET @paket_m1 = (SELECT paket_id FROM tb_soal WHERE materi_id=1 GROUP BY paket_id ORDER BY RAND() LIMIT 1);
	SET @paket_m2 = (SELECT paket_id FROM tb_soal WHERE materi_id=2 GROUP BY paket_id ORDER BY RAND() LIMIT 1);
	SET @paket_m3 = (SELECT paket_id FROM tb_soal WHERE materi_id=3 GROUP BY paket_id ORDER BY RAND() LIMIT 1);
	
	SET @qry1 := CONCAT('SELECT o.gc INTO @r FROM ( ',
			'SELECT GROUP_CONCAT(t.soal_id) AS gc FROM ( ',
			'SELECT 1 AS id, soal_id FROM tb_soal ',
			'WHERE materi_id = 1 AND paket_id = ',@paket_m1,' ORDER BY RAND() LIMIT ',@jml_m1,')t ',
			'GROUP BY t.id)o; ');
		PREPARE stmt FROM @qry1; 
		EXECUTE stmt;	
		SET @soal_m1 := @r;
		DEALLOCATE PREPARE stmt; 
		
	SET @qry2 := CONCAT('SELECT o.gc INTO @r FROM ( ',
			'SELECT GROUP_CONCAT(t.soal_id) AS gc FROM ( ',
			'SELECT 1 AS id, soal_id FROM tb_soal ',
			'WHERE materi_id = 2 AND paket_id = ',@paket_m2,' ORDER BY RAND() LIMIT ',@jml_m2,')t ',
			'GROUP BY t.id)o; ');
		PREPARE stmt FROM @qry2; 
		EXECUTE stmt;	
		SET @soal_m2 := @r;
		DEALLOCATE PREPARE stmt; 
				
	SET @qry3 := CONCAT('SELECT o.gc INTO @r FROM ( ',
			'SELECT GROUP_CONCAT(t.soal_id) AS gc FROM ( ',
			'SELECT 1 AS id, soal_id FROM tb_soal ',
			'WHERE materi_id = 3 AND paket_id = ',@paket_m3,' ORDER BY RAND() LIMIT ',@jml_m3,')t ',
			'GROUP BY t.id)o; ');
		PREPARE stmt FROM @qry3; 
		EXECUTE stmt;	
		SET @soal_m3 := @r;
		DEALLOCATE PREPARE stmt; 
		
	SET @pil_random = CONCAT ((SELECT GROUP_CONCAT(t.pil) AS gc FROM ( 
				SELECT  1 AS id,'pil1' AS pil UNION
				SELECT  1 AS id,'pil2' AS pil UNION
				SELECT  1 AS id,'pil3' AS pil UNION
				SELECT  1 AS id,'pil4' AS pil 
				ORDER BY RAND() )t GROUP BY t.id),',pil5'); 
				
	/*Campuran*/
	IF _jns_peserta_id=3 THEN
	      VALUES (_nop, 1, 2, @paket_m2, @soal_m2, @pil_random);
	      VALUES (_nop, 2, 3, @paket_m3, @soal_m3, @pil_random);
	      VALUES (_nop, 3, 1, @paket_m1, @soal_m1, @pil_random);
	END IF ;
	/*Sainteks*/
	IF _jns_peserta_id=1 THEN
	      VALUES (_nop, 1, 2, @paket_m2, @soal_m2, @pil_random);
	      VALUES (_nop, 2, 3, @paket_m3, @soal_m3, @pil_random);
	END IF ;
	/*Soshum*/
	IF _jns_peserta_id=2 THEN
	      VALUES (_nop, 1, 1, @paket_m1, @soal_m1, @pil_random);
	      VALUES (_nop, 2, 3, @paket_m3, @soal_m3, @pil_random);
	END IF ;
    END LOOP ;
  CLOSE curs ;
  COMMIT;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `sp_random1`
-- ----------------------------
DROP PROCEDURE IF EXISTS `sp_random1`;
DELIMITER ;;
CREATE DEFINER=`cbtsmbjm`@`%` PROCEDURE `sp_random1`()
BEGIN
  
  DECLARE _nop VARCHAR (20) ;
  DECLARE _jns_peserta_id SMALLINT(6);
  DECLARE done INT DEFAULT FALSE ;
  DECLARE curs CURSOR FOR SELECT nop, jns_peserta_id FROM tb_peserta;
  DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE ;
  
  START	TRANSACTION;
  DELETE FROM tb_random;
  ALTER TABLE tb_random AUTO_INCREMENT = 1;
  SET @jml_m1 = (SELECT jml_soal FROM tb_materi WHERE materi_id=1);
  SET @jml_m2 = (SELECT jml_soal FROM tb_materi WHERE materi_id=2);
  SET @jml_m3 = (SELECT jml_soal FROM tb_materi WHERE materi_id=3);
  OPEN curs ;
  read_loop : LOOP
    FETCH curs INTO _nop, _jns_peserta_id ;
    IF done THEN 
	LEAVE read_loop ;
    END IF ; 
	SET @paket_m1 = (SELECT _nop MOD 5)+1;
	SET @paket_m2 = (SELECT _nop MOD 5)+1;
	SET @paket_m3 = (SELECT _nop MOD 5)+1;
	
	SET @qry1 := CONCAT('SELECT o.gc INTO @r FROM ( ',
			'SELECT GROUP_CONCAT(t.soal_id) AS gc FROM ( ',
			'SELECT 1 AS id, soal_id FROM tb_soal ',
			'WHERE materi_id = 1 AND paket_id = ',@paket_m1,' ORDER BY RAND() LIMIT ',@jml_m1,')t ',
			'GROUP BY t.id)o; ');
		PREPARE stmt FROM @qry1; 
		EXECUTE stmt;	
		SET @soal_m1 := @r;
		DEALLOCATE PREPARE stmt; 
		
	SET @qry2 := CONCAT('SELECT o.gc INTO @r FROM ( ',
			'SELECT GROUP_CONCAT(t.soal_id) AS gc FROM ( ',
			'SELECT 1 AS id, soal_id FROM tb_soal ',
			'WHERE materi_id = 2 AND paket_id = ',@paket_m2,' ORDER BY RAND() LIMIT ',@jml_m2,')t ',
			'GROUP BY t.id)o; ');
		PREPARE stmt FROM @qry2; 
		EXECUTE stmt;	
		SET @soal_m2 := @r;
		DEALLOCATE PREPARE stmt; 
				
	SET @qry3 := CONCAT('SELECT o.gc INTO @r FROM ( ',
			'SELECT GROUP_CONCAT(t.soal_id) AS gc FROM ( ',
			'SELECT 1 AS id, soal_id FROM tb_soal ',
			'WHERE materi_id = 3 AND paket_id = ',@paket_m3,' ORDER BY RAND() LIMIT ',@jml_m3,')t ',
			'GROUP BY t.id)o; ');
		PREPARE stmt FROM @qry3; 
		EXECUTE stmt;	
		SET @soal_m3 := @r;
		DEALLOCATE PREPARE stmt; 
		
	SET @pil_random = CONCAT ((SELECT GROUP_CONCAT(t.pil) AS gc FROM ( 
				SELECT  1 AS id,'pil1' AS pil UNION
				SELECT  1 AS id,'pil2' AS pil UNION
				SELECT  1 AS id,'pil3' AS pil UNION
				SELECT  1 AS id,'pil4' AS pil 
				ORDER BY RAND() )t GROUP BY t.id),',pil5'); 
				
	/*Campuran*/
	IF _jns_peserta_id=3 THEN
	      VALUES (_nop, 1, 2, @paket_m2, @soal_m2, @pil_random);
	      VALUES (_nop, 2, 3, @paket_m3, @soal_m3, @pil_random);
	      VALUES (_nop, 3, 1, @paket_m1, @soal_m1, @pil_random);
	END IF ;
	/*Sainteks*/
	IF _jns_peserta_id=1 THEN
	      VALUES (_nop, 1, 2, @paket_m2, @soal_m2, @pil_random);
	      VALUES (_nop, 2, 3, @paket_m3, @soal_m3, @pil_random);
	END IF ;
	/*Soshum*/
	IF _jns_peserta_id=2 THEN
	      VALUES (_nop, 1, 1, @paket_m1, @soal_m1, @pil_random);
	      VALUES (_nop, 2, 3, @paket_m3, @soal_m3, @pil_random);
	END IF ;
    END LOOP ;
  CLOSE curs ;
  COMMIT;
END
;;
DELIMITER ;

